import './App.css';
import { experiences } from './experiences';

let tab = "experience";

function App() {
  function changeTab(e) {
    e.preventDefault();
    tab = e.currentTarget.textContent;
    console.log(tab);
  }

  return (
    <div className="App-header">
      <div className="App-aboutPage">
        <div className="App-rectangle">
          <img src="src/images/IG_headshot.jpg" alt="my headshot"/>
          <h1>hello, i'm hannah.</h1>
          <p>i am a junior at MIT studying computer science with a concentration in linguistics. i enjoy taking on creative and challenging projects, and i am especially passionate about spreading my love for technology to others through education.</p>
          <div clasName="App-socials"></div>
        </div>
        <div className="App-experience">
          <div className="App-aboutButtons">
            <p className="App-aboutButton" onClick={changeTab}>experience</p>
            <p className="App-aboutButton" onClick={changeTab}>my interests</p>
          </div>
          <div className="App-aboutSection">
            {tab === "experience" ? experiences.map((d) => 
              <div className="App-experienceBlock">
                <div className="App-experienceLine">
                  <div className="App-experienceCompany">{d.company}</div>
                  <div className="App-experienceDate">{d.dates}</div>
                </div>
                <div className="App-experienceLine">
                  <div className="App-experiencePosition">{d.position}</div>
                  <div className="App-experienceLocation">{d.location}</div>
                </div>
                <div className="App-experienceBlurb">
                  <div className="App-experienceBlurb">{d.summary}</div>
                </div>
                <hr/>
              </div>
            ): 
            <div className="App-interestsBlock">

            </div>
            }
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
